import React, { useContext } from "react";
import "./Portfolio.css";
import { Swiper, SwiperSlide } from "swiper/react";
import "swiper/css";
import { themeContext } from "../../Context";

const Portfolio = () => {
  const theme = useContext(themeContext);
  const darkMode = theme.state.darkMode;
  return (
    <div className="portfolio" id="portfolio">
      {/* heading */}
      <span style={{ color: darkMode ? 'white' : '' }}>Recent Projects</span>
      <span>Portfolio</span>

      {/* slider */}
      <Swiper
        spaceBetween={30}
        slidesPerView={3}
        grabCursor={true}
        className="portfolio-slider"
      >
        <SwiperSlide>
          <div className="video-container">
            <div className="video-thumbnail video1"></div>
            <button className="view-button" onClick={() => window.open('../../img/video1.mp4', '_blank')}>View</button>
          </div>
        </SwiperSlide>
        <SwiperSlide>
          <div className="video-container">
            <div className="video-thumbnail video2"></div>
            <button className="view-button" onClick={() => window.open('../../img/video2.mp4', '_blank')}>View</button>
          </div>
        </SwiperSlide>
        <SwiperSlide>
          <div className="video-container">
            <div className="video-thumbnail video3"></div>
            <button className="view-button" onClick={() => window.open('../../img/video3.mp4', '_blank')}>View</button>
          </div>
        </SwiperSlide>
        <SwiperSlide>
          <div className="video-container">
            <div className="video-thumbnail video4"></div>
            <button className="view-button" onClick={() => window.open('../../img/video4.mp4', '_blank')}>View</button>
          </div>
        </SwiperSlide>
      </Swiper>
    </div>
  );
};

export default Portfolio;
